import React, { useState } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import InputLabel from '@material-ui/core/InputLabel';
import FormHelperText from '@material-ui/core/FormHelperText';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import NativeSelect from '@material-ui/core/NativeSelect';
import AdminLinks from '../Navlinks/AdminNavLinks';
import { MenuItem } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
  formControl: {
    margin: theme.spacing(1),
    minWidth: 120,
  },
  selectEmpty: {
    marginTop: theme.spacing(2),
  },
}));

export default function SelectRole({handleChange, role, roles }) {
  const classes = useStyles();



  return(
      <div>
    <FormControl variant="filled" className={classes.formControl}>
    <InputLabel >Role</InputLabel>
    <Select onChange={handleChange} labelId="label"  value={role}>
    {roles.map(ex => {
              return  <MenuItem key={ex.id} value={ex.role} > {ex.role} </MenuItem>
          })} 
</Select>
{console.log(role)}
  </FormControl>
    </div>

  )

}
